// app.js
import React from 'react';
import Notif from './notif';

const App = () => {
  return (
    <div className="app-container">
      <header>
        <h1>COMMAND CENTER</h1>
        <div className="user-profile">
          <img src="/user-profile.png" alt="Profile" />
        </div>
      </header>
      <main>
        <aside className="sidebar">
          <ul>
            <li><i className="fas fa-tachometer-alt"></i> Dashboard</li>
            <li><i className="fas fa-cloud-upload-alt"></i> Early Warning System</li>
            <li><i className="fas fa-shield-alt"></i> Keamanan</li>
            <li><i className="fas fa-user"></i> One Gate System</li>
            <li><i className="fas fa-video"></i> CCTV</li>
            <li><i className="fas fa-clipboard-list"></i> Laporan Hasil Deteksi</li>
            <li><i className="fas fa-sun"></i> Panggilan Darurat</li>
          </ul>
        </aside>
        <section className="content">
          <Notif />
        </section>
      </main>
    </div>
  );
};

export default App;
